import java.util.ArrayList;
import java.util.Collections;
import java.util.HashSet;
import java.util.List;
import java.util.Set;

public class LongestDupSubstring {

	public static void main(String[] args) {
		//longestDupSubstring("\"\"");
		//longestDupSubstring("banana");
		System.out.println(longestDupSubstringRCA("banana"));

	}
	
	public static void longestDupSubstring(String S) {
		List<Integer> sA = new ArrayList<> ();
        for(int i=0; i<S.length(); i++) {
        	sA.add(i);
        }
        
        Collections.sort(sA, (int1, int2) -> {
        	return S.substring(int1).compareTo(S.substring(int2));
        });
        
        for(int i=0; i<S.length(); i++) {
        	System.out.println(sA.get(i));
        }
        
        int[] lcp = new int [S.length()];
        lcp[0] = 0;
        int x =0;
    	int c = 0;
    	String s1 ;
		String s2 ;
		int mV = -1;
		int mI=-1;
        for(int i =1; i<sA.size(); i++) {
        	 x =0;
        	 c = 0;
        	 s1 = S.substring(sA.get(i-1));
			 s2 = S.substring(sA.get(i));
        	while (x < s1.length() && x< s2.length()) {
        		if(s1.charAt(x)==s2.charAt(x)) {
        			c++;
        			x++;
        		}else {
        			break;
        		}
        	}
        	if(c > mV) {
        		mV = c;
        		mI = i;
        	}
        	lcp[i] = c;
        }
        
        System.out.println(lcp);
        System.out.println(S.length());
        System.out.println(mV);
        System.out.println(mI);
        System.out.println(sA.get(mI));
        System.out.println(S.substring(sA.get(mI), sA.get(mI)+mV));
    }
	
	public static String longestDupSubstringRCA(String s) {
		int start = 1;
		int end = s.length();
		String max = "";
		while (start <= end) {
			int mid = end - (end-start) / 2;
			String str = rabinKarp(s, mid);
			if (str.isEmpty()) {
				end = mid - 1;
			} else {
    			max = str;                
				start = mid + 1;
			}
		}
		return max;
	}
	
	public static String rabinKarp(String s, int len) {
		Set<Long> set = new HashSet<>();
		long h = hash(s.substring(0, len));
		set.add(h);
        long pow=1;
        for(int l=1;l<len;l++){
            pow*=26;
        }
		for (int i = 1; i <= s.length()-len; i++) {
            h=nextHash(pow,h,s.charAt(i - 1), s.charAt(i+len-1));
			if (!set.add(h)) {
                return s.substring(i, len + i);
			} 
		}
		return "";
	}
	public static long hash(String s) {
		long hash = 0;
        long mul=1;
		for (int i = s.length()-1; i >=0; i--) {
			hash += s.charAt(i)*mul;
            mul*=26;
		}
		return hash;
	}
	
	public static long nextHash(long pow, long h, char l, char r) {
		return (h - l * pow) * 26 + r;
	}

}
